import '../App.css'
import '../bootstrap.min.css'
import Timer from "../Components/Timer";
import Text2 from "./Text2";
import Earth from "./Earth";
import Uranus from "./Uranus";
import {useState, useEffect} from "react";
import { Link } from 'react-router-dom';

function Home() {

    const [current, setCurrent] = useState(<Earth/>);
    const [estilo, setEstilo] = useState("")
    const [page, setPage] = useState("1")
    const [days, setDays] = useState("365")
    const [planet, setPlanet] = useState("Earth")


    const [currentScreen, setCurrentScreen] = useState(1);
    const [wheelMotion, setWheel] = useState(0);


    function handleScroll(event) {
        console.log("mee", currentScreen)

        if (event.deltaY > 0) {
            setCurrentScreen(prevScreen => prevScreen + 1);
            setWheel(0);
        } else {
            setCurrentScreen(prevScreen => prevScreen - 1);
            setWheel(1);
        }
    }




    useEffect(() => {
        console.log("inside useeefect", props.wheel)
        console.log("inside 2", props.motion)

    //inicio da animação da Terra
        if (props.wheel === 5 && props.motion === 1) {
            //scroll up
            setEstilo("fade-in2")
            setCurrent(<Earth/>)
            setPage("1")
            setDays("365")
            setPlanet("Earth")
        }
        if (props.wheel === 10 && props.motion === 0) {
            setEstilo("fade-out1")
        }
        if (props.wheel === 20 && props.motion === 1) {
            setEstilo("fade-in1 centra")
            setCurrent(<Earth/>)
            setPage("1")
            setDays("365")
            setPlanet("Earth")
        }
        if (props.wheel === 25 && props.motion === 0) {
            setEstilo("fade-out2 centra")
        }
    //fim da animação da Terra

        if (props.wheel === 34 && props.motion === 1) {
            setCurrent(<Text2/>)
            setEstilo("textout centra")
            setPage("?")
            setDays("?")
            setPlanet("?")

        }

        if (props.wheel === 35 && props.motion === 0) {
            setCurrent(<Text2/>)
            setEstilo("textin centra")
            setPage("?")
            setDays("?")
            setPlanet("?")
        }

        if (props.wheel === 40 && props.motion === 0) {
            setCurrent(<Text2/>)
            setEstilo("textout centra")
            setPage("?")
            setDays("?")
            setPlanet("?")
        }
        if (props.wheel === 41 && props.motion === 1) {
            setCurrent(<Text2/>)
            setEstilo("textin centra")
            setPage("?")
            setDays("?")
            setPlanet("?")
        }

    //inicio da animação de Uranus
        if (props.wheel === 47 && props.motion === 1) {
            setEstilo("fade-out2 centra")
        }
        if (props.wheel === 50 && props.motion === 0) {
            setCurrent(<Uranus/>)
            setPage("2")
            setDays("30 680")
            setPlanet("Uranus")
        }
        if (props.wheel === 55 && props.motion === 0) {
            setEstilo("fade-in1 centra")
        }
        if (props.wheel === 64 && props.motion === 1) {
            setEstilo("fade-out1 centra")

        }

        if (props.wheel === 65 && props.motion === 0) {

            setEstilo("fade-in2 centra")
        }
        //fim da animação da Uranus


        if (props.wheel === 200) {
            setCurrent(<Uranus/>)
        }
    }, [props.wheel]);

    return (

        <div className={"bgblack container-fluid"}>
            <div className={"sticky-top"}>
                <div className={"timer"}>
                    <span className={"text-white amiri"}><Timer></Timer></span>
                </div>
                <div className={"counter"}>
                    <div className={"frac text-white amiri"}>
                        <span>{page}</span>
                        <span className={"symbol"}>/</span>
                        <span className={"bottom"}>2</span>
                    </div>
                </div>
                <div className={"days"}>
                    <span className={"text-white amiri"}>{days} days</span>
                </div>
                <div className={"planeti"}>
                    <span className={"text-white amiri"}> {planet} </span>
                </div>
            </div>
            <div className={"bggrain"}>
                <div className={estilo}>
                {current}
                </div>
            </div>


        </div>
    );
}

export default Home;
